import React from 'react';
import { useNavigate } from 'react-router-dom';
import { FaUserCircle, FaInfoCircle, FaSignOutAlt, FaTrashAlt } from 'react-icons/fa';

const Dashboard = () => {
  const navigate = useNavigate();

  const handleViewClubs = () => navigate('/clubs');
  const handleViewEvents = () => navigate('/events');
  const handleViewResources = () => navigate('/resources');
  const handleDeleteAccount = () => navigate('/delete-account');
  const handleLogout = () => navigate('/logout');
  const handleAbout = () => navigate('/about');

  return (
    <div
      style={{
        fontFamily: "'Roboto', sans-serif",
        backgroundColor: '#f3f4f6',
        minHeight: '100vh',
        display: 'flex',
        flexDirection: 'column',
      }}
    >
      {/* Header */}
      <header
        style={{
          backgroundColor: '#1f2937',
          color: '#fff',
          display: 'flex',
          justifyContent: 'space-between',
          alignItems: 'center',
          padding: '10px 20px',
        }}
      >
        <div>
          <h2 style={{ margin: 0 }}>Dashboard</h2>
        </div>
        <div style={{ display: 'flex', alignItems: 'center', gap: '15px' }}>
          {/* Profile Section */}
          <div
            style={{
              display: 'flex',
              alignItems: 'center',
              gap: '10px',
              cursor: 'pointer',
            }}
          >
            <FaUserCircle size={32} />
            <div>
              <p style={{ margin: 0 }}>John Doe</p>
              <small style={{ color: '#9ca3af' }}>john.doe@example.com</small>
            </div>
          </div>
          {/* Action Buttons */}
          <FaInfoCircle
            size={20}
            style={{ cursor: 'pointer', color: '#60a5fa' }}
            onClick={handleAbout}
            title="About"
          />
          <FaSignOutAlt
            size={20}
            style={{ cursor: 'pointer', color: '#f87171' }}
            onClick={handleLogout}
            title="Logout"
          />
          <FaTrashAlt
            size={20}
            style={{ cursor: 'pointer', color: '#ef4444' }}
            onClick={handleDeleteAccount}
            title="Delete Account"
          />
        </div>
      </header>

      {/* Main Content */}
      <main
        style={{
          flexGrow: 1,
          display: 'flex',
          flexDirection: 'column',
          justifyContent: 'center',
          alignItems: 'center',
          gap: '30px',
        }}
      >
        <h1 style={{ color: '#1f2937' }}>Welcome to Your Dashboard</h1>
        <div
          style={{
            display: 'grid',
            gridTemplateColumns: 'repeat(auto-fit, minmax(250px, 1fr))',
            gap: '20px',
            width: '80%',
            maxWidth: '800px',
          }}
        >
          {/* Button: Clubs */}
          <button
            onClick={handleViewClubs}
            style={{
              padding: '20px',
              backgroundColor: '#3b82f6',
              color: '#fff',
              border: 'none',
              borderRadius: '10px',
              cursor: 'pointer',
              fontSize: '18px',
              fontWeight: '500',
              boxShadow: '0 4px 6px rgba(0, 0, 0, 0.1)',
              transition: 'transform 0.2s, box-shadow 0.2s',
            }}
            onMouseEnter={(e) => {
              e.target.style.transform = 'scale(1.05)';
              e.target.style.boxShadow = '0 6px 8px rgba(0, 0, 0, 0.15)';
            }}
            onMouseLeave={(e) => {
              e.target.style.transform = 'scale(1)';
              e.target.style.boxShadow = '0 4px 6px rgba(0, 0, 0, 0.1)';
            }}
          >
            View Clubs
          </button>

          {/* Button: Events */}
          <button
            onClick={handleViewEvents}
            style={{
              padding: '20px',
              backgroundColor: '#10b981',
              color: '#fff',
              border: 'none',
              borderRadius: '10px',
              cursor: 'pointer',
              fontSize: '18px',
              fontWeight: '500',
              boxShadow: '0 4px 6px rgba(0, 0, 0, 0.1)',
              transition: 'transform 0.2s, box-shadow 0.2s',
            }}
            onMouseEnter={(e) => {
              e.target.style.transform = 'scale(1.05)';
              e.target.style.boxShadow = '0 6px 8px rgba(0, 0, 0, 0.15)';
            }}
            onMouseLeave={(e) => {
              e.target.style.transform = 'scale(1)';
              e.target.style.boxShadow = '0 4px 6px rgba(0, 0, 0, 0.1)';
            }}
          >
            View Events
          </button>

          {/* Button: Resources */}
          <button
            onClick={handleViewResources}
            style={{
              padding: '20px',
              backgroundColor: '#f59e0b',
              color: '#fff',
              border: 'none',
              borderRadius: '10px',
              cursor: 'pointer',
              fontSize: '18px',
              fontWeight: '500',
              boxShadow: '0 4px 6px rgba(0, 0, 0, 0.1)',
              transition: 'transform 0.2s, box-shadow 0.2s',
            }}
            onMouseEnter={(e) => {
              e.target.style.transform = 'scale(1.05)';
              e.target.style.boxShadow = '0 6px 8px rgba(0, 0, 0, 0.15)';
            }}
            onMouseLeave={(e) => {
              e.target.style.transform = 'scale(1)';
              e.target.style.boxShadow = '0 4px 6px rgba(0, 0, 0, 0.1)';
            }}
          >
            View Resources
          </button>
        </div>
      </main>

      {/* Footer */}
      <footer
        style={{
          textAlign: 'center',
          padding: '10px 20px',
          backgroundColor: '#1f2937',
          color: '#9ca3af',
        }}
      >
        Â© 2024 CSE CU Association
      </footer>
    </div>
  );
};

export default Dashboard;
